import React from 'react';
import PropTypes from 'prop-types';
import { ImageBackground, StyleSheet, View, Text, Image } from 'react-native'
import { Card, ListItem, Button, Icon } from 'react-native-elements'


const LearningCard = ({ location }) => {
  return (

      <Card
      >
        {/* Face Side */}
        <View  style = {styles.card} key = {location.id}>
          <Text style = {styles.text}>{location.Work} with {location.Partner}</Text>
          <Text style = {styles.text}>{location.StartTime} to {location.EndTime}</Text>
          <Text style = {styles.text}>Every {location.Days}</Text>
        </View>

      </Card>

  );
};

const styles = StyleSheet.create({
  text: {
    justifyContent: 'center',
    fontSize: 12,
    padding: 12,
    fontFamily: 'Georgia',
    fontWeight: 'bold'

  },
  card: {
    justifyContent: 'center',
    width: 150,
    height: 160,
    marginBottom: 12,
    paddingLeft: 10,
    paddingTop: 10,
    borderWidth: .5,
    borderColor: "gray",
    backgroundColor: "lavender",
    resizeMode: "cover",
    elevation: 17,
  },
  image: {
    width: 128,
    height: 100 ,
    justify: "center"
  },
  back:{
    justifyContent: 'center',
    marginBottom: 12,
    paddingLeft: 10,
    paddingTop: 10,
    flex: 1,
    borderWidth: .5,
    borderColor: "black",
    backgroundColor: "lavender",
    resizeMode: "cover",
    elevation: 17,
  },
  icon:{
    justifyContent: "right",
    marginBottom: 12,
    paddingLeft: 10,
    paddingTop: 10,
  }

})

export default LearningCard;
